import React, { useState, useEffect } from 'react';

function App() {
	const [counter, setCounter] = useState(5);

	useEffect(() => {
		document.title = counter;
	}, [counter]);

	return (
		<>
			<div>{counter}</div>
			<button onClick={() => setCounter(counter => counter + 1)}>Dodaj</button>
			<button onClick={() => setCounter(counter => counter - 1)}>
				Odejmij
			</button>
		</>
	);
}

export default App;
